import styled from "styled-components";
import { Label as LabelComponent } from "reactstrap";

export const Container = styled.div``;

export const Label = styled(LabelComponent)`
  margin-bottom: 0;
`;

export const UserData = styled.div`
  font-size: 1.5rem;
  font-weight: bold;
  line-height: 1.2;
`;
